<div class="container-fluid">
  <button type="button" class="btn btn-primary float-right m-3" id="dark">Dark</button>
  <button type="button" class="btn btn-primary float-right m-3" id="light">Light</button>


  <quantum-editor url="https://warp.cityzendata.net/api/v0/exec" theme="dark" id="editor"

                  config='{"buttonClass": "btn btn-primary float-right m-3", "messageClass": "alert alert-primary", "errorClass": "alert alert-danger" }'

                  warpscript="42
                  'ggg'
                  [
    NEWGTS 'testname' RENAME
    { 'label0' '42' 'label1' 'foo' } RELABEL
    100 NaN NaN NaN true ADDVALUE
    200 NaN NaN NaN false ADDVALUE
    300 NaN NaN NaN true ADDVALUE
    400 NaN NaN NaN true ADDVALUE
    500 NaN NaN NaN true ADDVALUE
    600 NaN NaN NaN true ADDVALUE
    700 NaN NaN NaN true ADDVALUE
    800 NaN NaN NaN true ADDVALUE

    NEWGTS
    'testname' RENAME
    { 'label0' '42' 'label1' 'foo' } RELABEL
    100 NaN NaN NaN true ADDVALUE
    200 NaN NaN NaN true ADDVALUE
    300 NaN NaN NaN true ADDVALUE
    400 NaN NaN NaN true ADDVALUE
    500 NaN NaN NaN true ADDVALUE
    600 NaN NaN NaN true ADDVALUE
    700 NaN NaN NaN true ADDVALUE
    2000 NaN NaN NaN false ADDVALUE
    ]
    [ SWAP bucketizer.and 2000 0 6 ] BUCKETIZE">
  </quantum-editor>
  <script language="JavaScript">
    $(function() {
      $("#dark").click(function() {
        $("#editor").attr("theme", "dark").attr("warpscript",'42');
      });
      $("#light").click(function() {
        $("#editor").attr("theme", "light").attr("warpscript",'1236546546');
      });
    });
